import React from "react";
import "./FaceRecognition.css";

function FaceRecognition({ imageUrl, box }) {
  return (
    <div>
      <div className="position-absolute">
        <img
          id="inputImage"
          src={imageUrl}
          alt=""
          width="500px"
          height="auto"
        />
        <div
          className="bounding-box"
          style={{
            top: box.topRow,
            right: box.rightCol,
            bottom: box.bottomRow,
            left: box.leftCol,
          }}
        ></div>
      </div>
    </div>
  );
}

export default FaceRecognition;
